import React from 'react';
import { Button } from 'reactstrap';
import 'react-toastify/dist/ReactToastify.css';
import useCopy from "@react-hook/copy";
import { useTranslation } from 'react-i18next';
import { toastSuccess } from '../helpers/toastCaller';

export interface ICopyModeratorLinkButtonInActiveCall{
    moderatorLink: string,
    buttonIcon: string

}

const CopyModeratorLinkButtonInActiveCall : React.FC<ICopyModeratorLinkButtonInActiveCall> = ({moderatorLink, buttonIcon}) => {
    const { copy } = useCopy(moderatorLink);    
    const { t } = useTranslation();
    return(
        <>
            <Button
            type="button"
            color="none"
            onClick={() => {
                copy();
                toastSuccess(t('Copied to clipboard a moderator invite!'));
            }}
            className="nav-btn user-profile-show"
            style={{
                color: "black",
                cursor: "pointer",
                marginLeft: "5px",
                fontSize: "18px",
                padding: "5px",
            }}
            >
                <i style={{
                    backgroundColor: "white",
                    height: 15,
                    width: 15,
                    borderRadius: 3,
                }}
                className={buttonIcon}></i>
            </Button>
        </>
    );
}

export default CopyModeratorLinkButtonInActiveCall;
